import styles from './Table.module.css'
import TableItem from './TableItem'
import { useSelector } from 'react-redux'
import { selectData } from '../State/dataSlice'
import { useState } from 'react'

function Table() {
  const dataInfo = useSelector(selectData)
  const [data, setData] = useState(dataInfo)
  if (dataInfo > 12) {
    setData(data.slice(0, 12))
  }

  return (
    <div className={styles.container}>
      <header>
        <div className={styles.table_header__items}>
          <h2>Номер запроса</h2>
        </div>
        <div className={styles.table_header__items}>
          <h2>Тип запроса</h2>
        </div>
        <div className={styles.table_header__items}>
          <h2>Описание</h2>
        </div>
        <div className={styles.table_header__items}>
          <h2>Пользователь</h2>
        </div>
        <div className={styles.table_header__items}>
          <h2>Дата</h2>
        </div>
        <div className={styles.table_header__items}>
          <h2>Статус</h2>
        </div>
      </header>
      {data.map((el, id) => {
        return (
          <TableItem
            key={id}
            number={el.number}
            type={el.typeRequest}
            description={el.description}
            user={el.userName}
            data={el.data}
            stat={el.status}
          />
        )
      })}
      {/* <TableItem
        number={1}
        type={`Новая функциональность`}
        description={`Прошу в сервис Свойства газа добавить`}
        user={`Иванов Иван Иванович`}
        data={`12.06.2023`}
        stat={`В работе`}
      /> */}
    </div>
  )
}

export default Table
